import React from 'react'

function Header() {
    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-dark" 
            style= {{
                backgroundColor: "#6d98ba"
            }}
        >
            <a className="header-name" href="/" style={{
                color: "9aadbf"
            }}>Error and Log Management</a>
        </nav>

        </div>
    )
}
export default Header;
